import { Icon, Stack, Text } from '@chakra-ui/react';
import { ReactElement } from 'react';
import { IoFitnessSharp } from 'react-icons';

import { BackgroundImage } from '../common/BackgroundImage';
import { usePrefetchTreatments } from '../treatments/hooks/useTreatments';

export function Home(): ReactElement {
  usePrefetchTreatments();

  return (
    <Stack align="center" justify="center" height="84vh">
      <BackgroundImage />
      <Text
        textAlign="center"
        fontFamily="Forum, sans-serif"
        fontSize="6em"
        color="white"
        zIndex={1}
        fontWeight="bold"
      >
        <Icon m={4} verticalAlign="top" as={IoFitness} />
        Fitness Center
      </Text>
      <Text>Hours: limited</Text>
      <Text>Address: nearby</Text>
    </Stack>
  );
}
